import { Switch } from "@mui/material";
import { useState } from "react";

const ByeSell = () => {
  const [checked, setChecked] = useState(true);
  const handleChange = (event) => {
    setChecked(event.target.checked);
    console.log(checked === true ? "Switch Off" : "Switch On");
  };

  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
            display: "flex",
            padding: 10,
          }}
        >
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <p
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              COIN NAME
            </p>
            <p
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              BUYING AMOUNT
            </p>
            <p
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              SELLING AMOUNT
            </p>
            <p
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              GRID AMOUNT
            </p>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_1
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_2
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_3
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_4
            </div>
          </div>
        </div>
        <div style={{ flex: 5, display: "flex", padding: 10 }}>
          {" "}
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              AUTO SELLING
            </p>
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              AUTO BUYING
            </p>
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              SELLING AMOUNT
            </p>
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              GRID AMOUNT
            </p>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <div style={{ height: "15%", width: "60%" }}>
              <Switch onChange={handleChange} defaultChecked />
            </div>
            <div style={{ height: "15%", width: "60%" }}>
              <Switch onChange={handleChange} defaultChecked />
            </div>
            <div style={{ height: "15%", width: "60%" }}>
              <Switch onChange={handleChange} defaultChecked />
            </div>
            <div style={{ height: "15%", width: "60%" }}>
              <Switch onChange={handleChange} defaultChecked />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ByeSell;
